import { Box, Button, Card, Container, Typography } from '@mui/material';
import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom'
import FormProvider from '../../components/form/FormProvider'
import "./cart.css";

import {
  addToCart,
  clearCart,
  decreaseCart,
  getTotals,
  removeFromCart,
} from "./cartSlice";

function CartOrder() {
  const cart = useSelector((state) => state.cart);
  const dispatch = useDispatch();
    useEffect(() => {
    dispatch(getTotals());
  }, [cart, dispatch]);

  const handleAddToCart = (product) => {
    dispatch(addToCart(product));
  };
  const handleDecreaseCart = (product) => {
    dispatch(decreaseCart(product));
  };
  const handleRemoveFromCart = (product) => {
    dispatch(removeFromCart(product));
  };
  const handleClearCart = () => {
    dispatch(clearCart());
  };
  return (
    <Container className="cart-container">
      <Typography variant='h4' textAlign="center">Shopping Cart</Typography>
       {cart.cartItems.length === 0 ? (
        <Box className="cart-empty">
          <Typography variant="h5" textAlign="center">Your cart is currently empty</Typography>
          <Box className="start-shopping">
            <Link to="/">
              <Typography variant="h6"> ðŸ”™ Start Shopping</Typography>
            </Link>
          </Box>
        </Box>
       ):(
        <Box>
          <Box className="titles">
            <h3 className="product-title">Product</h3>
            <h3 className="price">Price</h3>
            <h3 className="quantity">Quantity</h3>
            <h3 className="total">Total</h3>
          </Box>
          <Box className="cart-items">
               {cart.cartItems &&
              cart.cartItems.map((cartItem) => (
                <Box className="cart-item" key={cartItem.id}>
                  <Box className="cart-product">
                   <img src={cartItem.image} alt={cartItem.name} />
                    <div>
                     <h3>{cartItem.name}</h3>
                      <p>{cartItem.desc}</p>
                      <Button
                      onClick={() => handleRemoveFromCart(cartItem)}
                      >
                        Remove
                      </Button>
                    </div>
                  </Box>
                  <div className="cart-product-price">${cartItem.price}</div>
                  <div className="cart-product-quantity">
                    <Button
                    onClick={() => handleDecreaseCart(cartItem)}
                    >
                      âšŠ
                    </Button>
                    <div className="count">{cartItem.cartQuantity}</div>
                    <Button
                     onClick={() => handleAddToCart(cartItem)}
                    >
                      âœš
                    </Button>
                  </div>
                  <div className="cart-product-total-price">
                     ${cartItem.price * cartItem.cartQuantity}
                  </div>
                </Box>
              ))}
          </Box>
          <Box className="cart-summary">
            <Button 
            className="clear-btn"
            onClick={() => handleClearCart()}
            >
              Clear Cart
            </Button>
            <Box className="cart-checkout">
              <Box className="subtotal">
                <span>Subtotal</span>
                <span className="amount">${cart.cartTotalAmount}</span>
              </Box>
              <Typography>Taxes and shipping calculated at checkout</Typography>
              <Button>Check out</Button>
              <Box className="continue-shopping">
                <Link to="/store">
                 
                  <Typography variant="h6">ðŸ”™ Continue Shopping</Typography>
                </Link>
              </Box>
            </Box>
          </Box>
        </Box>
       )}
    </Container>
  )
}

export default CartOrder
